import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  useHistory
} from 'react-router-dom';
import BottomNavigation from '@material-ui/core/BottomNavigation';
import BottomNavigationAction from '@material-ui/core/BottomNavigationAction';
import { Money } from '@material-ui/icons';

import Home from './pages/Home';
import CryptoCurrency from './pages/CryptoCurrency';
import NotFound from './pages/NotFound';

export default function App () {
  const [value, setValue] = React.useState('recents');
  const history = useHistory();

  return (
    <>
      <Router>
        <Switch>
          <Route exact path="/">
            <Home />
          </Route>
          <Route exact path="/BTC">
            <CryptoCurrency currency="bitcoin" />
          </Route>
          <Route exact path="/EHT">
            <CryptoCurrency currency="ethereum" />
          </Route>
          <Route exact path="/TXL">
            <CryptoCurrency currency="tixl-new" />
          </Route>
          <Route path="/*">
            <NotFound />
          </Route>
        </Switch>
      </Router>
      <BottomNavigation
        value={value}
        onChange={(event, newValue) => {
          setValue(newValue);
        }}
        showLabels
      >
        <BottomNavigationAction onClick={() => history.push("/BTC")} label="BTC" icon={<Money />} />
        <BottomNavigationAction label="EHT" icon={<Money />} />
        <BottomNavigationAction label="TXL" icon={<Money />} />
      </BottomNavigation>
    </>
  );
}
